import React, { useState } from 'react';

const AntibioticForm = () => {
  const [antibiotic_form, set_antibiotic_form] = useState({
    prior_antibiotics: [{ name: '', route: '', duration: '', doses: '' }],
    pre_peri_antibiotics: [{ name: '', route: '', duration: '', doses: '' }],
    post_antibiotics: [{ name: '', route: '', duration: '', doses: '' }],
    prophylaxis: [{ name: '', route: '', duration: '', doses: '' }],
    time_induction: '',
    time_incision: '',
    end_time_surgery: '',
  });

  const handle_change = (e, section, index) => {
    const { name, value } = e.target;
    const updated_section = [...antibiotic_form[section]];
    updated_section[index][name] = value;
    set_antibiotic_form({ ...antibiotic_form, [section]: updated_section });
  };

  const handle_time_change = (e) => {
    const { name, value } = e.target;
    set_antibiotic_form({ ...antibiotic_form, [name]: value });
  };

  const routes_of_administration = [
    'I/V', 'I/M', 'S/C', 'I/D', 'P/O', 'Local Application', 'Sub Lingual',
  ];

  const doses_options = ['01', '02', '03', '04', '05'];

  const render_antibiotic_fields = (section) => (
    antibiotic_form[section].map((item, index) => (
      <div key={index} className="antibiotic-row">
        <input
          type="text"
          name="name"
          placeholder="Antibiotic Name"
          value={item.name}
          onChange={(e) => handle_change(e, section, index)}
        />
        <select
          name="route"
          value={item.route}
          onChange={(e) => handle_change(e, section, index)}
        >
          <option value="">Select Route</option>
          {routes_of_administration.map((route, idx) => (
            <option key={idx} value={route}>{route}</option>
          ))}
        </select>
        <input
          type="text"
          name="duration"
          placeholder="Duration"
          value={item.duration}
          onChange={(e) => handle_change(e, section, index)}
        />
        <select
          name="doses"
          value={item.doses}
          onChange={(e) => handle_change(e, section, index)}
        >
          <option value="">Select Doses</option>
          {doses_options.map((dose, idx) => (
            <option key={idx} value={dose}>{dose}</option>
          ))}
        </select>
      </div>
    ))
  );

  return (
    <form>
      <h2>Antibiotic Prescription Surveillance Form</h2>

      <h3>Antibiotics given prior to operation</h3>
      {render_antibiotic_fields('prior_antibiotics')}

      <h3>Antibiotics given Pre/Perioperatively</h3>
      {render_antibiotic_fields('pre_peri_antibiotics')}

      <h3>Antibiotics given after peri-operative</h3>
      {render_antibiotic_fields('post_antibiotics')}

      <h3>Prophylaxis</h3>
      {render_antibiotic_fields('prophylaxis')}

      <div>
        <label>Time of Induction:</label>
        <input
          type="time"
          name="time_induction"
          value={antibiotic_form.time_induction}
          onChange={handle_time_change}
        />
      </div>

      <div>
        <label>Time of Incision:</label>
        <input
          type="time"
          name="time_incision"
          value={antibiotic_form.time_incision}
          onChange={handle_time_change}
        />
      </div>

      <div>
        <label>End Time of Surgery:</label>
        <input
          type="time"
          name="end_time_surgery"
          value={antibiotic_form.end_time_surgery}
          onChange={handle_time_change}
        />
      </div>

      <button type="submit">Submit</button>
    </form>
  );
};

export default AntibioticForm;
